    "Environmental Assessment : Use of genetically modified, glyphosate-tolerant soybeans
    and corn on National Wildlife Refuge Lands in the Mountainu2013Prairie Region (Region
    6)",nt"tracking_summary": {ntt"total": 10,ntt"recent": 2nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2016-10-08T15:56:08.876809",nt"name":
    "environmental-assessment-use-of-genetically-modified-glyphosate-tolerant-soybeans-and-corn",nt"isopen":
    false,nt"url": null,nt"notes": "The Mountainu2013Prairie Region of the
    U.S. Fish and Wildlife Service currently uses row crop farming on lands within the
    National Wildlife Refuge System to achieve a variety of management objectives. Genetically
    modified, glyphosate-tolerant soybeans and corn are regularly used under this practice.
    The increased use of glyphosate-tolerant soybeans and corn and revised Service policies
    regarding the use of genetically modified organisms warrants an evaluation of their
    use. This environmental assessment evaluates the impacts of allowing and disallowing
    the use of glyphosate-tolerant soybeans and corn on System-managed lands in Region
    6. The analysis is based on issues and concerns identified during the planning process;
    a proposed action is identified on the basis of this analysis.",nt"license_title":
